import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p>I am a programmer</p>
      <a href="https://www.w3schools.com">Visit W3Schools.com!</a>
    </div>
  );
}


export default App;
